import React from "react";
import { NavLink } from "react-router-dom";
import AboutPage from "./AboutPage";
import ContactPage from "./ContactPage";
import HomePage from "./HomePage";
import Projects from "./Projects";

export const Navbar = () => {
  return (
      <>
      <div className='logo'>
        <img className='logo-class' src={process.env.PUBLIC_URL + '/name_icon.png'} />
      </div>
      <div className='navlinks'>
        <NavLink to='/' component={HomePage}>Home</NavLink>
        <NavLink to='/about' component={AboutPage}>Home</NavLink>
        <NavLink to='/projects' component={Projects}>Home</NavLink>
        <NavLink to='/contact' component={ContactPage}>Home</NavLink>
      </div>
      </>

  );
};

export default Navbar;
